package prathi.learn.practicealg.strings;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;


public class FindAnagrams {


    public static void main(String[] args) {
        String s = ""
;
        String p = "";
        List<Integer> result = findAnagrams(s, p);
        for (int res: result)
            System.out.println(res);
    }

    public static List<Integer> findAnagrams(String s, String p) {

        HashMap<Character, Integer> pattern = new HashMap<>();

        for (char pa: p.toCharArray()) {
            if (pattern.containsKey(pa)) {
                pattern.put(pa, pattern.get(pa)+1);
            } else {
                pattern.put(pa, 1);
            }
        }

        int start = 0;
        List<Integer> result =  new ArrayList<>();
        HashMap<Character, Integer> stringMap = new HashMap<>();
        for (int end = 0; end < s.length(); end++) {
            if (!pattern.containsKey(s.charAt(end))) {
                start = end + 1;
                stringMap.clear();
            } else {
                if (stringMap.containsKey(s.charAt(end))) {
                    stringMap.put(s.charAt(end), stringMap.get(s.charAt(end)) + 1);
                } else {
                    stringMap.put(s.charAt(end), 1);
                }

                if (end + 1 - start == p.length()) {
                    boolean isPalindrome = checkIfAnagram(pattern, stringMap);
                    if (isPalindrome) {
                        result.add(start);
                    }
                    int count = stringMap.get(s.charAt(start));
                    if (count == 1)
                        stringMap.remove(s.charAt(start));
                    else
                        stringMap.put(s.charAt(start), count - 1);
                    start++;
                }
            }
        }
        return result;

    }

    private static boolean checkIfAnagram(HashMap<Character, Integer> pattern, HashMap<Character, Integer> map) {

        if (pattern.size() != map.size())
            return false;
        for (Character ps:  pattern.keySet()) {
            int count = map.get(ps);
            int count2 = pattern.get(ps);
            if (count != count2) {
                return false;
            }
        }

        return true;
    }
}
